import React from "react";
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";
import * as Celebrity from "./info.js";
console.log(celebrity);

function appContent() {
  return ( < div > < Header / >
    <
    Note name = {
      celebrity.name
    }
    image = {
      celebrity.image
    }
    tel = {
      celebrity.tel
    }
    email = {
      celebrity.email
    }
    /> <
    Footer / > < /div>);
  }

  export default appContent;
